function Grades() {
    // In a real app, grades data might come from an API
    const grades = [
        { id: 1, course: 'Math 101', grade: 'A' },
        { id: 2, course: 'History 101', grade: 'B+' },
        { id: 3, course: 'Science 101', grade: 'A-' },
    ];

    return (
        <div>
            <h2>Grades</h2>
            <table>
                <thead>
                <tr>
                    <th>Course</th>
                    <th>Grade</th>
                </tr>
                </thead>
                <tbody>
                {grades.map((grade) => (
                    <tr key={grade.id}>
                        <td>{grade.course}</td>
                        <td>{grade.grade}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
}

export default Grades;
